import React from "react";
import Button from 'react-bootstrap/Button';
import "./Home.css";
const Home = () => {
  return (
    <>
      <div className="container home_container">
        <div className="home_innerdiv">
          <div className="left_div">
            <h2>
              Welcome to <span style={{ color: "#6c63ff" }}>Satyam Kumar</span>
            </h2>
            <p style={{ color: "#666", letterSpacing: ".5px", marginTop: 2 }}>
              Lorem ipsum dolor sit amet, consectetur adipisicing elit.
              Quibusdam dignissimos molestiae corporis! Id aut culpa ad beatae
              alias quis non ipsum distinctio possimus optio, architecto odit
              atque dolore mollitia perferendis!
            </p>
            <div className="btn_div" mt-4>
            <Button variant="danger" style={{ color: "#666", letterSpacing: "1px", border: null }}>Resume</Button>
            </div>
          </div>
          <div className="right_div">
            <img src="logo192.png" alt="logo" className="home_img" />
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
